import React from 'react';
import { useLocation, useNavigate } from 'react-router-dom';  // Import useLocation
import './Result.css';

const Result = () => {
    const location = useLocation();
    const navigate = useNavigate();
    const careers = location.state?.careers || [];

    return (
        <div className="result-container">
            <header className="header">
                <h1 className="title"> ðŸŽ¯ Your Career Recommendations</h1>
                <p className="subtitle">Based on your answers, here are your best matches:</p>
            </header>
            {careers.length > 0 ? (
                <div className="results-container">
                    <ul>
                        {careers.map((career, index) => {
                            const [titleDesc, tech = '', skills = '', knowledge = ''] = career.split('\n\n');
                            const [title, description] = titleDesc.split(' : ');
                            const techList = tech.replace('Technology Skills: ', '').split(',').map(s => s.trim());
                            const skillList = skills.replace('Skills: ', '').split(',').map(s => s.trim());
                            const knowledgeList = knowledge.replace('Knowledge: ', '').split(',').map(s => s.trim());

                            return (
                                <li key={index} className="career-item">
                                    <h2>{title}</h2>
                                    <p>{description}</p>
                                    <h3>Technology Skills</h3>
                                    <ul>{techList.map((item, i) => <li key={i}>{item}</li>)}</ul>
                                    <h3>Skills</h3>
                                    <ul>{skillList.map((item, i) => <li key={i}>{item}</li>)}</ul>
                                    <h3>Knowledge</h3>
                                    <ul>{knowledgeList.map((item, i) => <li key={i}>{item}</li>)}</ul>
                                </li>
                            );
                        })}
                    </ul>
                    <button className="restart-button" onClick={() => navigate('/')}>Take Quiz Again</button>
                </div>
            ) : (
                <p>No recommendations found. Please try again.</p>
            )}
        </div>
    );
};

export default Result;
